import React from 'react'
import './App.css'
const SearchResult = ({data}) => {
  return (
    <div className='search_result'>
    <ol>
      {data.map((value,index)=>{
        <li key={index}> {value.name}</li> 
      })}
      </ol>
    </div>
  )
}

export default SearchResult
